        html = DraftEpc.DwellingDetails(root, doc, html);
        html = DraftEpc.CostsTable(root, doc, html);
        html = DraftEpc.FeaturesTable(root, doc, html);
        html = DraftEpc.LowZero(root, doc, html);
        html = DraftEpc.RenewableHeat(root, doc, html);
        html = DraftEpc.SuggestedImprovements(root, doc, html);
        html = DraftEpc.Alternativemprovements(root, doc, html);
      }
      catch (Exception ex)
      {
        ProjectData.SetProjectError(ex);
        Console.WriteLine((object) ex);
        ProjectData.ClearProjectError();
      }
      return html;
    }

